package tests

import (
	"leetcode/problems"
	"testing"
)

func TestFindTheDifference(t *testing.T) {
	s := "abcd"
	d := "abcde"

	expected := byte('e')

	output := problems.FindTheDifference(s, d)

	if output != expected {
		t.Fatalf(`FindTheDifference(%q", %q) = %q, want %q`, s, d, output, expected)
	}
}

